import React from "react";
import HornedBeast from "./HornedBeast";
import data from './data.json';
import App from './App';

class Main extends React.Component {
    render () {
        let hornedBeast = []
        data.forEach(beast => {
            hornedBeast.push(
                <HornedBeast
                    name={beast.title}
                    imageUrl={beast.imageUrl}
                    description={beast.description}
                    horns={beast.horns}
                />    
            )
        })

        return (
            <main>
                {hornedBeast}
            </main>
            )
    }
}

export default Main;
